import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { XMarkIcon, MinusIcon } from '@heroicons/react/24/outline';
import Logo from '../assets/logo.png'; // Update with the correct path to your logo
import "./style/nav.css";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [sticky, setSticky] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setSticky(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <header className={`w-full rounded-b-lg bg-nav shadow-lg ring-1 ring-black/5 mb-16 transition-transform duration-300 ${sticky ? 'sticky top-0 z-50' : ''}`}>
      <div className="flex justify-between items-center p-5">
        <div className="img">
          <img src={Logo} alt="Logo" className='h-12 md:h-16 mr-5 rounded-full' />
        </div>
        <div className="hidden md:flex">
          <ul className='flex space-x-6'>
            <li><a href="#home" className='text-white text-lg hover:text-teal-400 transition'>Home</a></li>
            <li><a href="#aboutus" className='text-white text-lg hover:text-teal-400 transition'>About Us</a></li>
            <li><a href="#history" className='text-white text-lg hover:text-teal-400 transition'>Features</a></li>
            <li><a href="#testimonials" className='text-white text-lg hover:text-teal-400 transition'>Testimonials</a></li>
          </ul>
        </div>
        <div className="hidden md:block">
          <button className='text-white px-6 py-3 rounded-full bg-teal-500 hover:bg-teal-600 transition'>
            Download Now
          </button>
        </div>
        <div className="md:hidden flex items-center">
          <button onClick={() => setIsOpen(!isOpen)} className="text-white">
            {isOpen ? (
              <XMarkIcon className="h-8 w-8" />
            ) : (
              <MinusIcon className="h-8 w-8" />
            )}
          </button>
        </div>
      </div>

      {/* Full-Screen Blur Background */}
      <div className={`fixed inset-0 bg-black transition-opacity duration-300 ${isOpen ? 'opacity-70 z-40' : 'opacity-0 pointer-events-none'}`}></div>

      {/* Sliding Menu */}
      <div className={`fixed inset-0 bg-nav text-white transform transition-transform duration-300 z-50 ${isOpen ? 'translate-x-0' : 'translate-x-full'}`}>
        <div className="flex flex-col h-full justify-center items-center relative">
          {/* Close Button */}
          <button onClick={() => setIsOpen(false)} className="absolute top-5 right-5 text-white">
            <XMarkIcon className="h-8 w-8" />
          </button>
          <ul className='flex flex-col items-center space-y-6'>
            <li><a href="#home" className='text-white text-lg hover:text-teal-400 transition'>Home</a></li>
            <li><a href="#aboutus" className='text-white text-lg hover:text-teal-400 transition'>About Us</a></li>
            <li><a href="#history" className='text-white text-lg hover:text-teal-400 transition'>Features</a></li>
            <li><a href="#testimonials" className='text-white text-lg hover:text-teal-400 transition'>Testimonials</a></li>
            <li>
              <button className='text-white px-5 py-2 rounded-full bg-teal-600 hover:bg-teal-700 transition'>
                Download Now
              </button>
            </li>
          </ul>
        </div>
      </div>
    </header>
  );
};

export default Header;
